import React from 'react';
import { Routes, BrowserRouter as Router, Route } from 'react-router-dom';
import PrivatPrivateRouteseRoute from '../PrivateRoutes';

import Login from '../../pages/Login';
import List from '../../pages/List';
import Details from '../../pages/Details';
import NotFound from '../../pages/NotFound';

import './styles.scss';

function App() {
  return (
    <Router>
      <Routes>
        <Route element={<PrivateRoutes/>}>
              <Route path='/' element={<Users/>} />
              <Route path='/products' element={<Products/>} />
        </Route>

        <Route exact title="Login" path="/login" component={Login} />
        <PrivateRoute exact title="Details" path="/book/:id" component={Details} />
        <PrivateRoute exact title="List" path="/" component={List} />
        <PrivateRoute title="Not Found" component={NotFound} />
      </Routes>
    </Router>
  );
}

export default App;
